function hex2bin($dhhejeedad) {
	if (!is_string( $dhhejeedad )) {
		return null;
	}

	$cbjcajbabg = '';
	$cdeabhgbdd = 0;

	while ($cdeabhgbdd < strlen( $dhhejeedad )) {
		$cbjcajbabg .= chr( hexdec( $dhhejeedad[$cdeabhgbdd] . $dhhejeedad[$cdeabhgbdd + 1] ) );
		$cdeabhgbdd += 2;
	}

	return $cbjcajbabg;
}

